import React from 'react';
import logo from './logo.svg';
import Recipe from "./Recipe"
import './App.css';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <section id = "Header">
            <Recipe></Recipe>
        </section>
      </header>
    </div>
  );
}

export default App;
